console.log(raw.length);

const PAGE_WIDTH = 80;
const PAGE_HEIGHT = 40;

let get_codes = function(raw) {
    let codes = [];
    for (i=0; i<raw.length; i++) {
        codes.push( raw.charCodeAt(i) );
    }
    return codes;
}

let normalize = function(code) {
    //space
    if (code == 32) {
        return 0;
    }
    //period
    if (code == 44) {
        return 1;
    }
    //comma
    if (code == 46) {
        return 2;
    }
    // 'a' is 97 and all other letters follow
    return 3 + (code - 97);
}

let to_rgb = function(code) {
    if (code == 28) {
        return '#ffffff';
    }
    var scaled = Math.floor(code * Math.pow(256,3)/28);
    var hexstring = scaled.toString(16).padStart(6,0);
    return "#" + hexstring;
}

let draw_page = function(ctx, page_x, page_y, colors) {
    let offset_x = page_x * PAGE_WIDTH;
    let offset_y = page_y * PAGE_HEIGHT;
    //console.log("Offset: " + offset_x + ", " + offset_y);
    for (y=0; y<40; y++) {
        for (x=0; x<80; x++) {
            let idx = y * 80 + x;
            ctx.fillStyle = colors[idx];
            ctx.fillRect(offset_x + x, offset_y + y, 1, 1);
        }
    }
}

let draw_page_transpose = function(ctx, page_x, page_y, colors) {
    let offset_x = page_x * 40;
    let offset_y = page_y * 80;
    for (x=0; x<40; x++) {
        for (y=0; y<80; y++) {
            //let idx = y * 80 + x;
            let idx = x * 80 + y
            ctx.fillStyle = colors[idx];
            ctx.fillRect(offset_x + x, offset_y + y, 1, 1);
        }
    }
}

let fill_portrait = function(ctx, pages) {
    for (tile_y=0; tile_y<41; tile_y++) {
        for (tile_x=0; tile_x<10; tile_x++) {
            let page_idx = tile_y * 10 + tile_x
            draw_page(ctx, tile_x, tile_y, pages[page_idx]);
        }
    }
}

let fill_landscape_transpose = function(ctx, pages) {
    for (tile_x=0; tile_x<41; tile_x++) {
        for (tile_y=0; tile_y<10; tile_y++) {
            let page_idx = tile_y + tile_x * 10;
            draw_page_transpose(ctx, tile_x, tile_y, pages[page_idx]);
        }
    }
}

let to_pages = function(arr) {
    const CHARS_PER_PAGE = 80 * 40;
    let pages = [];
    for (let i=0; i<410; i++) {
        pages.push( arr.slice(i*CHARS_PER_PAGE, (i*CHARS_PER_PAGE)+CHARS_PER_PAGE) );
    }
    return pages;
}

let codes = get_codes(raw);
let normalized = codes.map(normalize);
let colors = normalized.map(to_rgb);
let pages = to_pages(colors);

let canvas = document.getElementById('babel');
let ctx = canvas.getContext('2d');

//fill_portrait(ctx, colors);
fill_landscape_transpose(ctx, pages);
